12.body:
DualSub has two different variants of nominal types; nominal data types and nominal codata types. Nominal Data Types Nominal data types are declared using the data keyword. For example, the following two declarations declare Booleans and Peano natural numbers, respectively. data Bool : CBV { True, False }; data Nat : CBV { Zero, Succ(Nat) }; Note that we have to indicate the evaluation order we want to use for that type. We can also use nominal data types to declare the unit and void type. data Unit : CBV { MkUnit };
data Void : CBV {}; When we declare parameterized data types, we have to declare both the kind of the type parameter, and its variance. For example, we can declare the type of lists of CBV types. data List(+a : CBV) : CBV { Nil, Cons(a, List(a))
}; In order for the algebraic subtyping approach to work, all type parameters have to be either covariant or contravariant. It currently isn't possible to use invariant type parameters, but such a feature might be added as syntactic sugar at a future point. Nominal Codata Types Codata types are introduced using the codata keyword. One of the standard examples of a codata type is the example of an infinite stream of natural numbers, called NatStream. A stream has two possible observations, Head and Tail, which we call the destructors of the codata type. The destructor Head returns the first element of the stream, and the destructor Tail returns the remainder of the stream. codata NatStream : CBN { Head[Nat], Tail[NatStream]
}; Codata types can also be parameterized, similar to the List example of the previous section. codata Stream(+a : CBV) : CBN { Head[a], Tail[Stream(a)]
}; Codata types make it possible to define the function type, instead of having a builtin function type like most functional programming languages. The declaration of the function type looks like this. codata Fun(-a : CBV, +b CBV) : CBN { Ap(a)[b]
}

14.body:
Structural refinement types are a novel idea in DualSub which combine features from both nominal and structural types. They are declared similarly to nominal types, but use the additional keyword refinement in front of the declaration refinement data Bool : CBV { True, False };
refinement codata NatStream : CBN { Head[Nat], Tail[NatStream]
}; The syntax for refinement types is very similar to the syntax for structural data and codata types, but the refined type is indicated by a vertical pipe in front of the constructors/destructors. The four possible refinements of the boolean type, for example, are written like this: < Bool | True, False >
< Bool | True >
< Bool | False >
< Bool | > And a refinement of the codata type of NatStream is written like this: { NatStream | Head[Nat] }

16.body:
DualSub is based on a term language for the sequent calculus. In distinction to lambda calculus, the term language of natural deduction, we have a first-class treatment of both producers and consumers of each type. In addition, there is a third syntactic category, commands. Commands are executable pieces of code. For example, it is possible to define producers, consumers and commands at the toplevel of the program, using prd, cns and cmd declarations: prd someProducer := ...;
cns someConsumer := ...;
cmd someCommand := ...; Toplevel declarations of consumers and producers can additionally be annotated with a type scheme. prd someProducer : ... := ...;
cns someConsumer : ... := ...; For example, the polymorphic identity function is defined like so: prd id : forall (a : CBV). a -> a := \x => x; If a function is used recursively in its own body, the rec keyword is necessary: prd rec add := \x y => case x of { Z => y, S(x) => S(add x y)
} There are five categories of terms in DualSub: Core constructs, which are independent of any concrete type. Producer introduction rules Consumer introduction rules Producer elimination rules Consumer elimination rules

18.body:
The rules for data and codata types are given separately Data Types Introduction rules for producers of codata types are just uses of the corresponding constructors: data Nat : CBV { Z, S(Nat) };
prd ex1 := S(Z); Codata Types Introduction rules for producers of codata types consists of copattern matching. codata Pair(+a : CBV, +b : CBV) : CBV { PiLeft[a], PiRight[b]
}; prd ex1 : Pair(Nat,Bool):= comatch { PiLeft[*] => 5, PiRight[*] => True }; prd ex2 : Pair(Nat,Bool):= comatch { PiLeft[k] => 5 >> k, PiRight[k] => True >> k };
